import React from 'react';
import {observer} from "mobx-react-lite";
import { PowerBIEmbed } from 'powerbi-client-react';
import { models } from 'powerbi-client';
import "./director.css"

const DirectorPage = () => {
    return (
        <div>
            <PowerBIEmbed
                embedConfig = {{
                    type: 'report',   // Supported types: report, dashboard, tile, visual and qna
                    id: 'fcf1184e-5dca-4b55-8f04-39e61ed42593',
                    embedUrl: 'https://app.powerbi.com/reportEmbed?reportId=81e69c29-575c-4dbe-8e0d-0d9ac72ca71f&autoAuth=true&ctid=bf435bf7-4d0b-41af-aec1-238e41c88d3b&config=eyJjbHVzdGVyVXJsIjoiaHR0cHM6Ly93YWJpLWdlcm1hbnktd2VzdC1jZW50cmFsLXByaW1hcnktcmVkaXJlY3QuYW5hbHlzaXMud2luZG93cy5uZXQvIn0%3D',
                    // accessToken: '..---EizKD-----wywG0WqZLHQL-',
                    tokenType: models.TokenType.Aad,
                    settings: {
                        panes: {
                            filters: {
                                expanded: false,
                                visible: false
                            }
                        },
                    }
                }}

                eventHandlers = {
                    new Map([
                        ['loaded', function () {console.log('Report loaded');}],
                        ['rendered', function () {console.log('Report rendered');}],
                        ['error', function (event) {console.log(event.detail);}]
                    ])
                }

                cssClassName = { "power-bi-container" }

                getEmbeddedComponent = { (embeddedReport) => {
                    window.report = embeddedReport;
                }}
            />
        </div>

    );
};

export default observer(DirectorPage);
